description:
GRRR! is a compilation album by The Rolling Stones. Released on 9 November 2012 in Europe, and the rest of the world on 12 November, it commemorates the band's 50th anniversary. The album features two new songs titled &quot;Doom and Gloom&quot; and &quot;One More Shot&quot;, which were recorded in August 2012. The album debuted at #3 on the UK Albums Chart.

